oxy_webhelp_navlinks = {"db_modules-d4330e34":{"topics":[{"title":"DBOS infrastructure elements ","shortdesc":"<p class=\"shortdesc\">DBOS infrastructure elements are required for deploying and ensuring the smooth         operation of the front-end and back-end on the client side, including all key services,         environments, and technical resources that enable the system to run and         function.<\/p>","href":"topics\/infrastructure_module.html","attributes":{"data-id":"infrastructure_module"},"menu":{"hasChildren":false},"tocID":"infrastructure_module-d4330e45","topics":[]},{"title":"Connectors (API)","shortdesc":"<p class=\"shortdesc\">Connectors are elements for connecting composite application with other third party         applications and  internal composite application components  between each other.<\/p>","href":"topics\/connectors_module.html","attributes":{"data-id":"connectors_module"},"menu":{"hasChildren":false},"tocID":"connectors_module-d4330e56","next":"connectors_module-d4330e56"},{"title":" DBOS service components","shortdesc":"<p class=\"shortdesc\">DBOS component is the container for program that implements the business logic and         configuration information. The program is a set of back-end operations that  the application         runs for the user. A component offers a service to other components and in turn consumes         functions offered by other services using service-oriented interfaces.<\/p>","href":"topics\/dbos_modul.html","attributes":{"data-id":"dbos_modul"},"menu":{"hasChildren":false},"tocID":"dbos_modul-d4330e151","next":"dbos_modul-d4330e151"},{"title":"Applications ","shortdesc":"<p class=\"shortdesc\">An application is a software package that performs a specific function directly for         an end user. An application can be self-contained or a group of programs. The program is a         set of back-end operations that runs the application for the user. Applications use the         computer's operating system (OS) and other supporting programs, typically system software,         to function. An application requests services from and communicates with other technologies         via an application programming interface (API).<\/p>","href":"topics\/applications_module.html","attributes":{"data-id":"applications_module"},"menu":{"hasChildren":false},"tocID":"applications_module-d4330e917","next":"applications_module-d4330e917"},{"title":"Tools","shortdesc":"<p class=\"shortdesc\">Tools это инструменты, которые использует компания для создания компоненотов,         аппликаций и т.д. То есть вспомагательные инструменты. Когда опен сорс апка внедряется в         состав компонента или другого элемента, туулс становится частью продукта финшейп и в этом         смысле не является тулсом а становится компонентом ДБОС, вне зависсимости от того встроен он         в код продукта финшейпа или просто колится компонентами или приложениями.<\/p>","href":"topics\/tools.html","attributes":{"data-id":"tools"},"menu":{"hasChildren":false},"tocID":"tools-d4330e1262","next":"tools-d4330e1262"}]}};